import Navbar from "components/Navbar";

const Index = () => {
  return (
    <>
      <div className="index">Index</div>
      <style jsx>{`
        .footer {
          position: fixed;
          left: 0;
          bottom: 0;
          width: 100%;
          text-align: center;
          font-family: Inconsolata;
          color: black;
          list-style-type: none;
        }
        .footer a {
          text-decoration: none;
          color: black;
          text-align: center;
        }
      `}</style>
    </>
  );
};

export default Index;
